/* qpsol:(h[102x102,210nz],g[102],a[72x102,192nz],lba[72],uba[72],lbx[102],ubx[102],x0[102],lam_x0[102],lam_a0[72],q[],p[])->(x[102],cost,lam_a[72],lam_x[102]) */
static int casadi_f8(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  int flag;
  struct casadi_qp_data d_qp;
  struct casadi_qp_prob p_qp;
  struct casadi_qrqp_data d;
  struct casadi_qrqp_prob p;
  d_qp.prob = &p_qp;
  p_qp.sp_a = casadi_s0;
  p_qp.sp_h = casadi_s1;
  casadi_qp_setup(&p_qp);
  casadi_qp_init(&d_qp, &iw, &w);
  d_qp.h = arg[0];
  d_qp.g = arg[1];
  d_qp.a = arg[2];
  d_qp.lbx = arg[5];
  d_qp.ubx = arg[6];
  d_qp.lba = arg[3];
  d_qp.uba = arg[4];
  d_qp.x0 = arg[7];
  d_qp.lam_x0 = arg[8];
  d_qp.lam_a0 = arg[9];
  d_qp.f = res[1];
  d_qp.x = res[0];
  d_qp.lam_x = res[3];
  d_qp.lam_a = res[2];
  p.qp = &p_qp;
  p.sp_at = casadi_s2;
  p.sp_kkt = casadi_s3;
  p.sp_v = casadi_s4;
  p.sp_r = casadi_s5;
  p.prinv = casadi_s6;
  p.pc =  casadi_s7;
  casadi_qrqp_setup(&p);
  p.max_iter = 1000;
  p.min_lam = 0;
  p.constr_viol_tol = 1e-08;
  p.dual_inf_tol = 1e-08;
  d.prob = &p;
  d.qp = &d_qp;
  casadi_qrqp_init(&d, &iw, &w);
  /* Pass bounds on z */
  if (arg[5]) {
    casadi_copy(arg[5], 102, d.lbz);
  } else {
    casadi_fill(d.lbz, 102, -casadi_inf);
  }
  if (arg[3]) {
    casadi_copy(arg[3], 72, d.lbz+102);
  } else {
    casadi_fill(d.lbz+102, 72, -casadi_inf);
  }
  if (arg[6]) {
    casadi_copy(arg[6], 102, d.ubz);
  } else {
    casadi_fill(d.ubz, 102, casadi_inf);
  }
  if (arg[4]) {
    casadi_copy(arg[4], 72, d.ubz+102);
  } else {
    casadi_fill(d.ubz+102, 72, casadi_inf);
  }
  /* Pass initial guess */
  if (arg[7]) {
    casadi_copy(arg[7], 102, d.z);
  } else {
    casadi_clear(d.z, 102);
  }
  casadi_fill(d.z+102, 72, casadi_nan);
  if (arg[8]) {
    casadi_copy(arg[8], 102, d.lam);
  } else {
    casadi_clear(d.lam, 102);
  }
  if (arg[9]) {
    casadi_copy(arg[9], 72, d.lam+102);
  } else {
    casadi_clear(d.lam+102, 72);
  }
  /* Solve QP */
  if (casadi_qrqp_reset(&d)) return 1;
  while (1) {
    flag = casadi_qrqp_prepare(&d);
    if (flag || casadi_qrqp_iterate(&d)) break;
  }
  /* Get solution */
  if (res[1]) casadi_copy(&d.f, 1, res[1]);
  if (res[0]) casadi_copy(d.z, 102, res[0]);
  if (res[3]) casadi_copy(d.lam, 102, res[3]);
  if (res[2]) casadi_copy(d.lam+102, 72, res[2]);
  if (d.status == QP_SUCCESS) {;
    return 0;
  } else if (d.status == QP_NO_SEARCH_DIR) {
    return 4;
  } else {
    return -1;
  }
  return 0;
}

/* solver:(x0[102],p[108],lbx[102],ubx[102],lbg[72],ubg[72],lam_x0[102],lam_g0[72])->(x[102],f,g[72],lam_x[102],lam_g[72],lam_p[108]) */
static int casadi_f3(const casadi_real** arg, casadi_real** res, casadi_int* iw, casadi_real* w, int mem) {
  casadi_int iter_count=0, ls_iter=0;
  casadi_real F_sens, du_inf, dx_norminf, fk_cand, l1, l1_cand, l1_infeas, pr_inf, sigma=0.0, t=0.0, tl1;
  const casadi_real one=1;
  int ret;
  struct casadi_nlpsol_data d_nlp;
  struct casadi_nlpsol_prob p_nlp;
  struct casadi_oracle_data d_oracle;
  struct casadi_sqpmethod_data* d=&casadi_f3_mem[mem];
  struct casadi_sqpmethod_prob p;
  d_nlp.oracle = &d_oracle;
  d_nlp.p = arg[1];
  d_nlp.lbx = arg[2];
  d_nlp.ubx = arg[3];
  d_nlp.lbg = arg[4];
  d_nlp.ubg = arg[5];
  d_nlp.x0 = arg[0];
  d_nlp.lam_x0 = arg[6];
  d_nlp.lam_g0 = arg[7];
  d_nlp.x = res[0];
  d_nlp.f = res[1];
  d_nlp.g = res[2];
  d_nlp.lam_x = res[3];
  d_nlp.lam_g = res[4];
  d_nlp.lam_p = res[5];
  d_nlp.prob = &p_nlp;
  p_nlp.nx = 102;
  p_nlp.ng = 72;
  p_nlp.np = 108;
  p_nlp.detect_bounds.ng = 0;
  casadi_nlpsol_init(&d_nlp, &arg, &res, &iw, &w);
  if (d_nlp.x0) {
    casadi_copy(d_nlp.x0, 102, d_nlp.z);
  } else {
    casadi_clear(d_nlp.z, 102);
  }
  if (d_nlp.lbx) {
    casadi_copy(d_nlp.lbx, 102, d_nlp.lbz);
  } else {
    casadi_fill(d_nlp.lbz, 102, -casadi_inf);
  }
  if (d_nlp.ubx) {
    casadi_copy(d_nlp.ubx, 102, d_nlp.ubz);
  } else {
    casadi_fill(d_nlp.ubz, 102, casadi_inf);
  }
  if (d_nlp.lam_x0) {
    casadi_copy(d_nlp.lam_x0, 102, d_nlp.lam);
  } else {
    casadi_clear(d_nlp.lam, 102);
  }
  if (d_nlp.lbg) {
    casadi_copy(d_nlp.lbg, 72, d_nlp.lbz+102);
  } else {
    casadi_fill(d_nlp.lbz+102, 72, -casadi_inf);
  }
  if (d_nlp.ubg) {
    casadi_copy(d_nlp.ubg, 72, d_nlp.ubz+102);
  } else {
    casadi_fill(d_nlp.ubz+102, 72, casadi_inf);
  }
  if (d_nlp.lam_g0) {
    casadi_copy(d_nlp.lam_g0, 72, d_nlp.lam+102);
  } else {
    casadi_clear(d_nlp.lam+102, 72);
  }
  d->prob = &p;
  p.sp_h = casadi_s1;
  p.sp_a = casadi_s0;
  p.merit_memsize = 4;
  p.max_iter_ls = 3;
  p.nlp = &p_nlp;
  casadi_sqpmethod_init(d, &arg, &res, &iw, &w, 0, 0);
  casadi_clear(d->dx, 102);
  /* MAIN OPTIMIZATION LOOP */
  while (1) {
    /* Evaluate f, g and first order derivative information */
    d->arg[0] = d_nlp.z;
    d->arg[1] = d_nlp.p;
    d->res[0] = &d_nlp.objective;
    d->res[1] = d->gf;
    d->res[2] = d_nlp.z+102;
    d->res[3] = d->Jk;
    if (casadi_f6(d->arg, d->res, d->iw, d->w, 0)) return 1;
    /* Evaluate the gradient of the Lagrangian */
    casadi_copy(d->gf, 102, d->gLag);
    casadi_mv(d->Jk, casadi_s0, d_nlp.lam+102, d->gLag, 1);
    casadi_axpy(102, 1.0, d_nlp.lam, d->gLag);
    /* Primal infeasability */
    pr_inf = casadi_max_viol(174, d_nlp.z, d_nlp.lbz, d_nlp.ubz);
    /* inf-norm of lagrange gradient */
    du_inf = casadi_norm_inf(102, d->gLag);
    /* inf-norm of step */
    dx_norminf = casadi_norm_inf(102, d->dx);
    /* Checking convergence criteria */
    if (iter_count >= 0 && pr_inf < 1e-06 && du_inf < 1e-06) break;
    if (iter_count >= 50) break;
    if (iter_count >= 1 && iter_count >= 0 && dx_norminf <= 1e-10) break;
    /* Update/reset exact Hessian */
    d->arg[0] = d_nlp.z;
    d->arg[1] = d_nlp.p;
    d->arg[2] = &one;
    d->arg[3] = d_nlp.lam+102;
    d->res[0] = d->Bk;
    if (casadi_f7(d->arg, d->res, d->iw, d->w, 0)) return 1;
    /* Formulate the QP */
    casadi_copy(d_nlp.lbz, 174, d->lbdz);
    casadi_axpy(174, -1.0, d_nlp.z, d->lbdz);
    casadi_copy(d_nlp.ubz, 174, d->ubdz);
    casadi_axpy(174, -1.0, d_nlp.z, d->ubdz);
    /* Initial guess */
    casadi_copy(d_nlp.lam, 174, d->dlam);
    casadi_clear(d->dx, 102);
    /* Increase counter */
    iter_count++;
    /* Solve the QP */
    d->arg[0] = 0;
    d->arg[1] = 0;
    d->arg[2] = 0;
    d->arg[3] = 0;
    d->arg[4] = 0;
    d->arg[5] = 0;
    d->arg[6] = 0;
    d->arg[7] = 0;
    d->arg[8] = 0;
    d->arg[9] = 0;
    d->arg[10] = 0;
    d->arg[11] = 0;
    d->arg[0] = d->Bk;
    d->arg[1] = d->gf;
    d->arg[7] = d->dx;
    d->arg[8] = d->dlam;
    d->arg[9] = d->dlam+102;
    d->arg[5] = d->lbdz;
    d->arg[6] = d->ubdz;
    d->arg[2] = d->Jk;
    d->arg[3] = d->lbdz+102;
    d->arg[4] = d->ubdz+102;
    d->res[0] = 0;
    d->res[1] = 0;
    d->res[2] = 0;
    d->res[3] = 0;
    d->res[0] = d->dx;
    d->res[3] = d->dlam;
    d->res[2] = d->dlam+102;
    ret = casadi_f8(d->arg, d->res, d->iw, d->w, 0);
    if (ret == -1000) return -1000;
    /* Calculate penalty parameter of merit function */
    sigma = casadi_fmax(sigma, (1.01*casadi_norm_inf(174, d->dlam)));;
    /* Calculate L1-merit function in the actual iterate */
    l1_infeas = casadi_sum_viol(174, d_nlp.z, d_nlp.lbz, d_nlp.ubz);
    l1 = d_nlp.objective + sigma * l1_infeas;
    /* Detecting indefiniteness */
    /* Right-hand side of Armijo condition */
    F_sens = casadi_dot(102, d->dx, d->gf);
    tl1 = F_sens - sigma * l1_infeas;
    /* Stepsize */
    t = 1.0;
    /* Merit function value in candidate */
    l1_cand = 0.0;
    /* Reset line-search counter, success marker */
    ls_iter = 0;
    /* Line-search loop */
    while (1) {
      /*  Increase counter */
      ls_iter++;
      /* Candidate step */
      casadi_copy(d_nlp.z, 102, d->z_cand);
      casadi_axpy(102, t, d->dx, d->z_cand);
      /* Evaluating objective and constraints */
      d->arg[0] = d->z_cand;
      d->arg[1] = d_nlp.p;
      d->res[0] = &fk_cand;
      d->res[1] = d->z_cand+102;
      if (casadi_f5(d->arg, d->res, d->iw, d->w, 0)) {
        /* Avoid infinite recursion */
        if (ls_iter == 3) {
          break;
        }
        /* line-search failed, skip iteration */
        t = 0.8* t;
        continue;
      }
      /* Calculating merit-function in candidate */
      l1_cand = fk_cand + sigma * casadi_sum_viol(174, d->z_cand, d_nlp.lbz, d_nlp.ubz);
      if (l1_cand <= l1 + t * 0.0001* tl1) {
        break;
      }
      /* Line-search not successful, but we accept it. */
      if (ls_iter == 3) {
        break;
      }
      /* Backtracking */
      t = 0.8* t;
    }
    /* Candidate accepted, update dual variables */
    casadi_scal(174, 1-t, d_nlp.lam);
    casadi_axpy(174, t, d->dlam, d_nlp.lam);
    casadi_scal(102, t, d->dx);
    /* Take step */
    casadi_axpy(102, 1.0, d->dx, d_nlp.z);
  }
  d->arg[0] = d_nlp.z;
  d->arg[1] = d_nlp.p;
  d->arg[2] = &one;
  d->arg[3] = d_nlp.lam+102;
  d->res[0] = 0;
  d->res[1] = 0;
  d->res[2] = 0;
  d->res[3] = d_nlp.lam_p;
  if (casadi_f4(d->arg, d->res, d->iw, d->w, 0)) return 1;
  casadi_scal(108, -1.0, d_nlp.lam_p);
  casadi_copy(d_nlp.z, 102, d_nlp.x);
  casadi_copy(d_nlp.z + 102, 72, d_nlp.g);
  casadi_copy(d_nlp.lam, 102, d_nlp.lam_x);
  casadi_copy(d_nlp.lam + 102, 72, d_nlp.lam_g);
  if (d_nlp.f) casadi_copy(&d_nlp.objective, 1, d_nlp.f);
  if (d_nlp.lam_p) casadi_copy(d_nlp.lam_p, 108, d_nlp.lam_p);
  return 0;
}

